 is a gonadotropin-releasing hormone ( DB00644 ) receptor antagonist that , in common with

 agonists ( e . g . leuprolide , goserelin and triptorelin ) , is indicated for use as an androgen-deprivation therapy in patients with advanced prostate cancer . In 1 - year , randomized , open-label , phase II or III trials in patients with all stages of prostate cancer , subcutaneous degarelix was associated with rapid , profound and sustained suppression of serum testosterone and prostate-specific antigen ( PSA ) , without evidence of testosterone surges or microsurges . In the phase III trial , degarelix ( 240 mg initially followed by 80 mg every 28 days ) was considered to be effective and noninferior to intramuscular leuprolide ( 7.5 mg every 28 days ) with regard to inducing and maintaining suppression of serum testosterone to castrate levels ( i . e . &lt; or = 0.5 ng / mL ) .

 induced testosterone suppression more rapidly than leuprolide . Median serum testosterone levels of &lt; or = 0.5 ng / mL were achieved by day 3 in degarelix recipients , but not until day 28 in leuprolide recipients . PSA suppression was also more rapid with degarelix than with leuprolide , with significant between-group differences in serum PSA levels favouring degarelix at 14 and 28 days .

<div class="entities" style="line-height: 2.5; direction: ltr">Agonists and antagonists of DB00644 and - II reduce metastasis formation by triple-negative human breast cancer cells in vivo . Metastasis to bone is a frequent problem of advanced breast cancer . Particularly breast cancers , which do not express estrogen and progesterone receptors and which have no overexpression / amplification of the

 - positive human breast cancers to prevent metastasis formation .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Functional methionine synthase deficiency ( cblE and cblG ) : clinical and biochemical heterogeneity . Functional methionine synthase deficiency is generally characterized by homocystinuria and hypomethioninemia in the absence of methylmalonic aciduria . Patients are divided into two classes , cblE and cblG , on the basis of complementation analysis . Presentation has usually been in the first 2 years of life , but one patient came to medical attention at age 21 years with symptoms initially diagnosed as multiple sclerosis . Common findings among 11 patients ( 4 with cblE and 7 with cblG ) have included megaloblastic anemia ( all patients ) and various neurological deficits including developmental retardation ( 10 patients ) , cerebral atrophy ( 8 patients ) , hypotonia ( 7 patients ) , EEG abnormalities ( 6 patients ) , and nystagmus ( 5 patients ) . Hypertonia , seizures , blindness , and ataxia were less frequent . All patients have responded to therapy with cobalamin with resolution of anemia and biochemical abnormalities ; neurological deficits resolved more slowly and in some cases incompletely . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has been more effective than cyanocobalamin . Fibroblasts from patients with cblE ( 5 patients ) and cblG ( 6 patients ) all showed decreased intracellular levels of methylcobalamin ( DB03614 ) and decreased incorporation of label from 5 - methyltetrahydrofolate into macromolecules , suggesting decreased activity of the DB03614 - dependent enzyme methionine synthase . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99707

</mark>

<div class="entities" style="line-height: 2.5; direction: ltr">Targeted therapy in gastric cancer . Gastric cancer is often diagnosed at an advanced stage . Although chemotherapy prolongs survival and improves quality of life , the survival of gastric cancer patients with advanced disease is short . Thanks to recent insights into the molecular pathways involved in gastric carcinogenesis , new targeted treatment options have become available for gastric cancer patients .

</mark>
 , an antibody targeted to HER - 2 , was shown to improve survival of advanced gastric cancer patients harboring HER - 2 overexpression due to gene amplification in their tumor cells , and is currently also explored in adjuvant and neoadjuvant settings . Another agent with promising results in clinical trials is ramucirumab , an antibody targeting 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . No clear survival benefit , however , were experienced with agents targeting 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( cetuximab , panitumumab ) ,

 ( bevacizumab ) , or

 kinase / AKT pathway as a therapeutic target in multiple myeloma . The development of novel therapies for multiple myeloma depends on a comprehensive understanding of the events leading to cellular proliferation and survival . Controlling pathways that regulate growth signals is an emerging and complementary approach to myeloma treatment . The PI3K / Akt pathway is a central gatekeeper for crucial cellular functions including adhesion , angiogenesis , migration and development of drug resistance . Established proteins and genes such as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , p53 , NF-kappaB and

 are all regulated through PI3K and Akt activation , making them attractive targets for broad downstream effects . Direct PI3K inhibition has demonstrated impressive tumor inhibition and regression in cell-line and animal models , and multiple agents including 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
